<!DOCTYPE html>
<script><title>Content of SignedHTTPExchange</title></script><script><title>Content of SignedHTTPExchange</title></script>
<script>
window.addEventListener('message', (event) => {
  event.data.port.postMessage({
      location: document.location.href,
      referrer: document.referrer,
      is_fallback: false});
}, false);
</script>
